import { React } from "react";

const SavedPost = (props) => {
    const { posts } = props;
    // console.log(posts);
    let month = [
        "Jan",
        "Feb",
        "March",
        "April",
        "May",
        "Jun",
        "Jul",
        "Aug",
        "Sep",
        "Oct",
        "Nov",
        "Dec",
    ];

    return posts.map((card) => {
        return (
            <div className="card mt-4" key={card.id}>
                <div className="card-body">
                    <p>{card.message}</p>

                    <img
                        src={card.gifUrl}
                        alt={card.id}
                        width="150px"
                        className="d-inline-block"
                    ></img>
                </div>

                <div className="card-footer">
                    <p>
                        {month[card.date.getMonth()].toUpperCase()},{" "}
                        {card.date.getDate()} {card.date.getFullYear()}
                    </p>
                </div>
            </div>
        );
    });
};

export default SavedPost;
